import './App.css';
import TopLayer from './layout';

import { useSelector, useDispatch } from 'react-redux';
import { fetchPosts } from './redux/action';
import { useEffect } from 'react';


function App() {
  const {posts, loading} = useSelector((state: any) => ({...state.data})); 
  const dispatch : any = useDispatch();
  useEffect(()=>{
    console.log(posts)
  })
  return (
    <div className="App">
    <TopLayer/>
    <button onClick={()=> dispatch(fetchPosts())}>fetch posts</button>
    {loading? (posts.map((post: any)=> <h1>test</h1>)): (<h2>loading</h2>)}
    </div>
  );
}

export default App;
